import './Rodape.css'
import { AccessAlarm, ThreeDRotation } from '@mui/icons-material';
import { BsFacebook } from "react-icons/bs";

const Rodape = () => {
    return (<footer className='footer'>
        <div>
            <a href='facebook.com' target="_blank">
                <BsFacebook />
            </a>
        </div>
    </footer>)
}

export default Rodape
